import React from "react";
import styled from 'styled-components';

const Container = styled.div`
    height: 70px;
    border: 1px solid grey;
    padding: 50px 15rem;
`;

const Banner = styled.div`
    display: flex;
    flex-grow: 1;
    color:white;
    background-image: linear-gradient(90deg,#01a9fe -12%,#2f5fef 37%,#046afe 72%,#00d2dd 110%);
    justify-content: center;
    -ms-flex-align: center;
    align-items: center;

    font-size: 14px;
    font-weight: 700;
    border-radius: 38.5px;
    border: 1px solid grey;
    padding: 21px 30px;
    font-size: 18px;
    line-height: normal;
    
`;
const EmploymentButton = () => { 
    return(
        <Container> 
            <Banner>
            <svg xmlns="https://www.w3.org/2000/svg" xlink="https://www.w3.org/1999/xlink" width="28" height="28" viewBox="0 0 18 18">
                <defs>
                    <path id="qt2dnsql4a" d="M15.727 17.273a.563.563 0 10.796-.796l-4.875-4.875-.19-.165a.563.563 0 00-.764.028 5.063 5.063 0 111.261-2.068.562.562 0 101.073.338 6.188 6.188 0 10-1.943 2.894l4.642 4.644z">
                    </path>
                </defs>
                <g fill="none" fill-rule="evenodd">
                    <use fill="#fff" fill-rule="nonzero" stroke="#fff" stroke-width=".3" xlink="#qt2dnsql4a">
                        </use>
                </g>
            </svg>
                채용 중인 포지션 보러가기
            </Banner>
            
        </Container>
    );
}

export default EmploymentButton;
